import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { Provider } from 'react-redux';
import store from './store'; // Importe o store que você configurou
import reportWebVitals from './reportWebVitals';

import '../src/css/login/stylesscss.scss'; // Importe seu arquivo SCSS aqui


const toggleButton = document.getElementById('meutesteid');
const body = document.body;

toggleButton.addEventListener('click', () => {
    body.classList.toggle('meuteste2');
});

const mostrarImagem = ''


var elemento = document.getElementById('foto');


if(mostrarImagem !== ''){
  elemento.src = mostrarImagem;
}



const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
      <Provider store={store}>
      <App />
      </Provider>
    
     {/* <NewApp />  */}
  </React.StrictMode>
);



// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
